import React from 'react'

import './UsersList.scss'

const UsersList = ({items}) => {
  if(props.items.length === 0) {
    return <div className='center'>
      <h2>No Users found.</h2>
    </div>
  }
  return (
    <div>UsersList</div>
  )
}

export default UsersList
